INSERT INTO `pages` (`id`, `created_at`, `updated_at`, `title`, `content`, `showAsLink`) VALUES
(1, '2023-03-30 08:25:56', '2023-04-03 09:33:03', 'Terms and conditions', '<p>Welcome to MYQRSHOP! By accessing or using our services, you agree to be bound by the following terms and conditions (&quot;Terms&quot;). If you do not agree to these Terms, please do not use our services.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1. Account and Registration</p>\r\n\r\n<p>To use our services, you must create an account and provide accurate and complete information. You are solely responsible for maintaining the confidentiality of your account and password, and for all activities that occur under your account. You agree to notify us immediately of any unauthorized use of your account or any other breach of security. We reserve the right to refuse service, terminate accounts, or remove or edit content in our sole discretion.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2. Intellectual Property Rights</p>\r\n\r\n<p>All content and materials on MYQRSHOP, including but not limited to text, graphics, logos, button icons, images, audio clips, digital downloads, data compilations, and software, are the property of MYQRSHOP or its content suppliers and are protected by international copyright, trademark, and other intellectual property laws.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3. Prohibited Conduct</p>\r\n\r\n<p>You agree not to use our services to:</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;a. Violate any applicable laws or regulations</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;b. Infringe the intellectual property rights of others</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;c. Transmit any viruses or other harmful code</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;d. Collect or store personal information of others without their consent</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;e. Use our services for any illegal or unauthorized purpose</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4. Disclaimer of Warranties</p>\r\n\r\n<p>We provide our services on an &quot;as is&quot; and &quot;as available&quot; basis, without any warranties of any kind, whether express or implied, including but not limited to warranties of merchantability, fitness for a particular purpose, and non-infringement.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5. Limitation of Liability</p>\r\n\r\n<p>We shall not be liable for any direct, indirect, incidental, special, or consequential damages arising out of or in connection with the use of our services, including but not limited to damages for loss of profits, goodwill, use, data, or other intangible losses.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;6. Indemnification</p>\r\n\r\n<p>You agree to indemnify and hold MYQRSHOP and its affiliates, officers, agents, and employees harmless from any claim or demand, including reasonable attorneys&#39; fees, made by any third party due to or arising out of your use of our services, your violation of these Terms, or your violation of any rights of another.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;7. Governing Law</p>\r\n\r\n<p>These Terms shall be governed by and construed in accordance with the laws of [insert country/state/province], without giving effect to any principles of conflicts of law.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;8. Modifications</p>\r\n\r\n<p>We reserve the right to modify these Terms at any time, without prior notice to you. Your continued use of our services after any such modifications shall constitute your acceptance of the revised Terms.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;9. Termination</p>\r\n\r\n<p>We may terminate these Terms or suspend your access to our services at any time, without prior notice to you, for any reason, including but not limited to your violation of these Terms or any other agreement with us.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;10. Entire Agreement</p>\r\n\r\n<p>These Terms constitute the entire agreement between you and MYQRSHOP with respect to the use of our services and supersede all prior or contemporaneous communications and proposals, whether oral or written, between you and MYQRSHOP.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1),
(2, '2023-03-30 08:25:56', '2023-04-03 06:25:56', 'Privacy Policy', '<p>Privacy Policy</p>\r\n\r\n<p>At MYQRSHOP, we value your privacy and are committed to protecting your personal information. This Privacy Policy explains how we collect, use, and disclose information when you use our website or services.</p>\r\n\r\n<p>Information We Collect</p>\r\n\r\n<p>We collect information you provide when you use our services, including:</p>\r\n\r\n<ul>\r\n	<li>Personal Information: such as your name, email address, and phone number.</li>\r\n	<li>Transaction Information: such as payment information, billing and shipping addresses, and order details.</li>\r\n	<li>Usage Information: such as your IP address, device type, and browser information.</li>\r\n	<li>Location Information: if you grant us access to your location data.</li>\r\n</ul>\r\n\r\n<p>How We Use Your Information</p>\r\n\r\n<p>We use the information we collect to:</p>\r\n\r\n<ul>\r\n	<li>Provide and improve our services</li>\r\n	<li>Process transactions and fulfill orders</li>\r\n	<li>Communicate with you about your orders and provide customer support</li>\r\n	<li>Send you marketing communications and promotional offers</li>\r\n	<li>Analyze and improve our website and services</li>\r\n	<li>Comply with legal obligations</li>\r\n</ul>\r\n\r\n<p>We may share your information with third-party service providers that assist us with these purposes, such as payment processors, shipping providers, and marketing partners.</p>\r\n\r\n<p>Your Choices</p>\r\n\r\n<p>You can choose not to provide certain information, but this may limit your ability to use our services. You can also opt out of receiving marketing communications by following the instructions in the communication or contacting us at [insert contact information].</p>\r\n\r\n<p>Security</p>\r\n\r\n<p>We take reasonable measures to protect your personal information from unauthorized access, disclosure, or misuse. However, no security system is perfect and we cannot guarantee the security of your information.</p>\r\n\r\n<p>Changes to This Policy</p>\r\n\r\n<p>We may update this Privacy Policy from time to time by posting the updated version on our website. Your continued use of our services after these changes are posted constitutes your acceptance of the updated policy.</p>\r\n\r\n<p>Contact Us</p>\r\n\r\n<p>If you have any questions or concerns about this Privacy Policy, please contact us at [info@myqrshop.com].</p>', 1),
(3, '2023-04-03 06:18:11', '2023-04-03 06:48:38', 'FAQ\'s', '<p><strong>&nbsp; &nbsp; &nbsp; 1. What is a QR code?</strong></p>\r\n\r\n<p>A QR code is a two-dimensional barcode that can be scanned by a smartphone camera to quickly access information such as website URLs, contact details, and product information.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; 2.&nbsp;How do I generate a QR code on MyQRShop?</strong></p>\r\n\r\n<p>To generate a QR code on MyQRShop, you need to enter the information you want to encode into the QR code, select the QR code type, and click on the &quot;Generate&quot; button. The website will then create a QR code image that you can download or share.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; 3. What types of QR codes can I generate on MyQRShop?</strong></p>\r\n\r\n<p>MyQRShop supports a wide range of QR code types, including website URLs, email addresses, phone numbers, SMS messages, WiFi access points, and more.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; 4. Can I customize the design of my QR code?</strong></p>\r\n\r\n<p>Yes, you can customize the design of your QR code on MyQRShop. You can choose from a range of colors, add your own logo or image, and adjust the size and shape of the QR code.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; 5. How do I scan a QR code?</strong></p>\r\n\r\n<p>To scan a QR code, you need a smartphone with a camera and a QR code scanner app. Open the app, point the camera at the QR code, and the app will automatically scan and decode the information.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; 6. Can I track the usage of my QR code?</strong></p>\r\n\r\n<p>Yes, MyQRShop offers tracking and analytics features that allow you to monitor the usage of your QR code. You can see how many times the code has been scanned, where it was scanned, and what type of device was used.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; 7. How long will my QR code be valid?</strong></p>\r\n\r\n<p>Your QR code will be valid for as long as you want it to be. You can choose to set an expiration date or keep the code active indefinitely.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; 8. Can I use my QR code for commercial purposes?</strong></p>\r\n\r\n<p>Yes, you can use your QR code for commercial purposes. MyQRShop allows you to create and use QR codes for marketing campaigns, advertising, and other commercial purposes.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; 9. Is it safe to use QR codes?</strong></p>\r\n\r\n<p>QR codes themselves are safe to use, but you should be cautious when scanning codes from unknown sources. It&#39;s important to ensure that the code leads to a legitimate website or information source, and to avoid downloading any unknown apps or software.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; 10. Can I edit my QR code after it has been generated?</strong></p>\r\n\r\n<p>No, once a QR code has been generated, it cannot be edited. If you need to make changes to the information in the code, you will need to generate a new QR code.</p>\r\n\r\n<p>&nbsp;</p>', 1);
